import React, { Component } from "react";
import Link from ''

class QuickLinks extends Component {
  render() {
    return (
      <div id="footer" className="d-flex flex-column">
        <div class="header d-inline-flex px-2 pt-4">
          <h4> About Us </h4>
        </div>
        <hr class="bg-light w-100" />
        <div class="content my-2">
          <p class="px-1 py-3">
            Lorem ipsum dolor sit amet, consectetur adipisicing elit. Animi quo,
            doloremque error aspernatur quae soluta eius placeat facilis tempora
            veniam ex iusto similique a eveniet unde praesentium accusamus
            voluptatum! Ab?
            <span>
                <Link>
                    <a>More...</a>
                </Link>
            </span>
          </p>
        </div>
      </div>
    );
  }
}

export default QuickLinks;
